import React, { useState } from 'react';
import Header from './components/Header';
import Table from './components/Table';
import Form from './components/Form';

const dummy_calculations = [
  {
    year: 1,
    yearlyInterest: 500,
    totalSavings: 11700,
    yearlyContribution: 11200,
  },
  {
    year: 2,
    yearlyInterest: 585,
    totalSavings: 13485,
    yearlyContribution: 12400
  },
  {
    year: 3,
    yearlyInterest:674,
    totalSavings: 15359,
    yearlyContribution: 13600
  },
];

function App() {
  const [calculations, setCalculations] = useState(dummy_calculations);

  const saveYearlyDataHandler = (enteredYearlyData) => {
    const calculations = {
      ...enteredYearlyData,
    } 
  }


  return (
    <div>
      <Header />
      <Form onSaveYearlyData={saveYearlyDataHandler} /> 


      {/* Todo: Show below table conditionally (only once result data is available) */}
      {/* Show fallback text if no data is available */}

      <Table calculations={calculations}/>
    </div>
  );
}

export default App;
